import React, { useState } from 'react';
import { Tabs, Tab } from '@mui/material';
import ActiveTabComponent from '../certifications/activeTab'
import InactiveTabComponent from '../certifications/inactiveTab'
import '../employerStyle.scss'
const CertificationCourses = (props) => {
  const [tabValue, setTabValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setTabValue(newValue);
  };
  return (
    <div className="dashboardPageContainer">
      <div className="JobsActivesTabConatainer">
        <Tabs value={tabValue} onChange={handleChange} TabIndicatorProps={{ sx: { display: 'none' } }}
          sx={{
            '& .MuiTabs-flexContainer': {
              flexWrap: 'wrap',
            },
          }}>
          <Tab label="Active courses" />
          <Tab label="Inactive courses" />
        </Tabs>
        {tabValue === 0 && <ActiveTabComponent />}
        {tabValue === 1 && <InactiveTabComponent />}
      </div>
    </div>
  );
}

export default CertificationCourses;
